import React from 'react';
import './App.css';

import  KeyPad  from './components/keyPad';
import  Result  from './components/result';
import CalculationProvider from './components/CalculationProvider';

function App() {

  return (
    <div className="App">
      <CalculationProvider>
        <Result />
        <KeyPad />       
      </CalculationProvider>
    </div>
  );
}

export default App;
